7. Mewujudkan kelestarian fungsi lingkungan hidup;

1. Memperkuat tata-kelola pemerintahan yang baik dan bersih;
2. Menurunkan angka kemiskinan dibawah rata-rata Provinsi Sulawesi Tengah dan rata-rata nasional;
3. Mengembangkan kawasan pertumbuhan ekonomi sesuai dengan daya dukung dan potensi wilayah;
4. Mengembangkan kualitas sumber daya manusia melalui peningkatan kualitas pendidikan dan pelayanan kesehatan;
5. Menurunkan jumlah desa tertinggal dan terpencil;
6. Memperkuat pertumbuhan ekonomi kerakyatan yang bertumpu pada sumber daya alam dan kelestarian lingkungan hidup;
7. Meningkatkan ketahanan pangan melalui peningkatan infrastruktur, sarana dan prasaran pertanian dan perikanan;
8. Merestorasi tata ruang kota kabupaten dan kota-kota kecamatan menjadi kota yang nyaman.
9. Meningkatkan taraf kehidupan beragama, politik, hukum, budaya dalam tatanan kearifan lokal.

1. MENGEMBANGKAN PEREKONOMIAN KOTA YANG BERDAYA SAING DAN BERTUMPU PADA KEPELABUHAN DAN INDUSTRI;
2. MEWUJUDKAN SUMBERDAYA MANUSIA YANG BERKUALITAS, AGAMIS DAN BERJATI DIRI MELAYU;
3. MEWUJUDKAN INFRASTRUKTUR WILAYAH YANG BERKUALITAS SESUIA DAYA DUKUNG DAN FUNGSI RUANG;
4. MENINGKATKAN KAPASITAS DAN PROFESIONALITAS APARATUR PEMERINTAH DAERAH DALAM RANGKA MEWUJUDKAN KEPEMERINTAHAN DAERAH YANG BAIK;
5. MEWUJUDKAN DUMAI SEBAGAI LINGKUNGAN YANG HIJAU
